import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todo, settodo] = useState()
  const a = [1,2,3]
  useEffect( () => {
    axios.get('/todos')
      .then(res => {
        console.log(res)
        settodo(res.data)
      })
      .catch(err => {
        console.log(err)
      })

  },[])
  return (
    <div className="App">
        {console.log(todo)}
        {
          a.map( data => {
            return <p key={data.id}>{data.title}</p>
          })
        };
    </div>
  );
}

export default App;
